import React from "react";
import "./App.css";
import { FaHeart } from 'react-icons/fa';
import { FiMessageCircle } from 'react-icons/fa';
import { FaTelegramPlane } from 'react-icons/fa';
import { BsBookmark } from 'react-icons/fa';
const Post = ()=>{
    return(
        <div className="post">
            <div>
                <div className="postF">
                  <div className="postFF">
                    <div className="postimg">
                      <img src="/images/images.png" placeholder="img" />
                     </div>
                      <a>dibya aaaaaaaaaaaaaaaaaaaaaaa</a>
                  </div>
                  <div className="postf">
                  ...
                  </div>
                </div>
                <div className="postM">
                    <img src="/images/images.png" placeholder="im" />
                </div>
                <div className="postL">
                    <div>
                        <FaHeart />
                        <FiMessageCircle />
                        <FaTelegramPlane />
                        <BsBookmark />
                    </div>
                </div>
            </div>
        </div>
    );
}
export default Post;
